INSERT INTO `menu_custom` (`menu_name`, `title`, `description`) VALUES
('navigation', 'Навигация', 'Навигационное меню автоматически создаётся Drupal и служит главным интерактивным меню для любого сайта. Обычно это единственное меню, которое содержит личные ссылки для авторизованных пользователей, оно часто скрыто от анонимных посетителей.'),
('primary-links', 'Основные ссылки', 'Основные ссылки часто используются на уровне тем оформления для показа главных разделов сайта. Типичным вариантом таких ссылок может быть ряд вкладок сверху страницы.'),
('secondary-links', 'Дополнительные ссылки', 'Дополнительные ссылки часто используются для страниц наподобие контактной информации, условий пользования и других вторичных пунктов меню, которые не так важны как основные ссылки.');
