('node/add/story', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:5:"story";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/story', 'Заметка', 'check_plain', '', 6, '', '<em>Заметка</em> - подобна <em>странице</em>, идеальный способ для создания и отображения содержания, информирующего и привлекающего посетителей. Пресс-релизы, объявления и записи, подобные записям в блоге могут быть созданы посредством <em>заметки</em>. По умолчанию, <em>заметка</em> может быть отображена на главной странице и комментироваться пользователями.', '', 0, 'modules/node/node.pages.inc'),
