('story', 'Заметка', 'node', '<em>Заметка</em> - подобна <em>странице</em>, идеальный способ для создания и отображения содержания, информирующего и привлекающего посетителей. Пресс-релизы, объявления и записи, подобные записям в блоге могут быть созданы посредством <em>заметки</em>. По умолчанию, <em>заметка</em> может быть отображена на главной странице и комментироваться пользователями.', '', 1, 'Заголовок', 1, 'Содержимое', 0, 1, 1, 0, 'story');
